def nullify(product, key):
    val = product[key]
    if not val: return "NULL"
    if not isinstance(val, str): return int(val * 100)
    return f"'{val}'"

f = open("query-vals.txt", "w")
for p in products:
    id = nullify(p, "Variant SKU")
    name = nullify(p, "Handle")
    image = nullify(p, "Variant Image")
    option1 = nullify(p, "Option1 Value")
    option2 = nullify(p, "Option2 Value")
    price = nullify(p, "Variant Price")
    f.write(f"({id}, {name}, {image}, {option1}, {option2}, {price}),\n")
f.close()
